  input: TEXT,F3A,,"This memo is in response to the Commission's letter of July 27,
    2004.  Data entry errors occured in the records of Mingledorff, Minis, Newton,
    Stanley and People with Hart, Inc.  The election code has been amended and memo
    entries entered.  A redesignation  letter has been sent to Jeffrey Jepson. Mr.
    Jepson was advised that $1000 of his $2000 was needs to be redesignated to the
    General election and if he does not want that done this amount will be refunded
    to him.  A refund check to Pfizer for $400 was reported on this report.  The 159
    Group was researched on the FEC webpage and since it has not received multicandidate
    status a  refund check for $4000 was issued in July and will be reflected on the
    October 15 report.  After researching all the National Conservative Campaign Fund's
    contributions a $1000 refund was issued in July and will be reflected on the October
    15 report.  As requested, copies of the above will be sent to your attention via
    U.S Mail.  As discussed the actual due date of the loan is 8/4/06 as shown in
    this amendment."
